const rows = [
  {
    id: 1,
    Category: "Category 1",
    Subcategories: 3,
  },
  {
    id: 2,
    Category: "Category 2",
    Subcategories: 2,
  },
];

const mockData = {
  1: {
    content: [
      {
        type: "table",
        data: {
          rows: [
            {
              id: 1,
              Test: "Initial AT",
              Date: "2019-12-04",
              Result: true,
            },
            {
              id: 2,
              Test: "Mid Year AT",
              Date: "2020-06-11",
              Result: true,
            },
          ],
        },
      },
      {
        type: "linegraph",
        data: {
          xData: ["2019-12-04", "2020-06-11"],
          yData: [75, 85],
          title: "Test Data Line Graph",
        },
      },
    ],
  },
  2: {
    content: [
      {
        type: "table",
        data: {
          rows: [
            {
              id: 1,
              Test: "Initial BT",
              Date: "2019-11-20",
              Result: false,
            },
            {
              id: 2,
              Test: "End Year BT",
              Date: "2020-11-30",
              Result: true,
            },
          ],
        },
      },
      {
        type: "bargraph",
        data: {
          xData: ["2019-11-20", "2020-11-30"],
          yData: [65, 80],
          title: "Test Data Bar Graph",
        },
      },
    ],
  },
};

export { rows, mockData };
